import React, {Component} from 'react';

const url = 'https://raw.githubuserprice.com/aleisabl/Burger-Queen/take-order/burger-queen/src/menu/burger-queen.json';

class ComponentData extends Component {
    constructor(props) {
      super(props);

      this.state = {
        data: null,
      };
    }

    componentDidMount() {
      fetch(url)
        .then(response => response.json())
        .then(data => this.setState({ data }));
    }

    render() {
      return (
        <p>Hola</p>
      )
    }
}

export default ComponentData;
